import React, { Component } from 'react';

class Projects extends Component {
    render() {
        return (
<div class="card" style={{width: "20rem"}}>
              <img class="card-img-top img-fluid" src="/images/QueDj_App.png" alt="Card image cap" />
              <div class="card-block">
                <h4 class="card-title">QueDj</h4>
                <p class="card-text">Full Stack CRUD app that allows users to submit songs to a que for your favorite DJ to play. <br /> <br /> Technologies: HTML, CSS, JavaScript, Node.js, Express.js, BCrypt, jQuery, PostgreSQL</p>
                <a href="https://quedj.herokuapp.com" target="_blank" class="btn tryMe-button">Try Me!</a>
                <a href="https://github.com/itajenglish/QueDJ" target="_blank" class="btn repo-button">See Github Repo</a>
              </div>
            </div>        );
    }
}

export default Projects;
